        "";
char buffer[205] = {0};

int startsWith(const char *str, const char *other) {
    return strncmp(other, str, strlen(other)) == 0;
}

int main(void) {
    int n = 0;

    scanf("%s", buffer);

    for (n = 0;; n++) {
        if (startsWith(str + n, buffer)) {
            printf("%d", n + 1);
            return 0;
        }
    }
}